import React from 'react'

export function Header() {
  return (
    <div className='mainHeader'>
        <a href='/'>Home</a>
        <a href='/signin'>Sign In</a>
        <a href='/signup'>Sign up</a>
        <a href='/account'>Account</a>
    </div>
  )
}
